import React, { useState, useEffect } from 'react';
import Hero from '../components/resume/hero';
import Skills from '../components/resume/skills';
import ExperienceSection from '../components/resume/experience';
import Projects from '../components/resume/projects';
import EducationSection from '../components/resume/education';
import Footer from '../components/resume/footer';
import { Profile, Experience, Project, Skill, Education } from '../entities/all';

export default function Resume() {
  const [profile, setProfile] = useState(null);
  const [experiences, setExperiences] = useState([]);
  const [projects, setProjects] = useState([]);
  const [skills, setSkills] = useState([]);
  const [education, setEducation] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const loadData = async () => {
      try {
        setLoading(true);

        // Load profile
        const profileData = await Profile.list('-created_date');
        if (profileData && profileData.length > 0) {
          setProfile(profileData[0]);
        }

        // Load experiences
        const experienceData = await Experience.list('-start_date');
        setExperiences(experienceData || []);

        // Load projects
        const projectData = await Project.list('-start_date');
        setProjects(projectData || []);

        // Load skills
        const skillData = await Skill.list('category');
        setSkills(skillData || []);

        // Load education
        const educationData = await Education.list('-start_date');
        setEducation(educationData || []);

        setLoading(false);
      } catch (err) {
        console.error('加载数据失败:', err);
        setError(err.message);
        setLoading(false);
      }
    };

    loadData();
  }, []);

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-gray-50 to-gray-100">
        <div className="text-2xl font-medium text-gray-700 flex items-center">
          <svg className="animate-spin -ml-1 mr-3 h-6 w-6 text-indigo-600" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
            <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
            <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
          </svg>
          加载中...
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-gray-50 to-gray-100">
        <div className="text-2xl text-red-500 font-medium flex items-center">
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 mr-2" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8v4m0 4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
          </svg>
          加载失败: {error}
        </div>
      </div>
    );
  }

  // 检查是否有数据
  const hasData = profile || experiences.length > 0 || projects.length > 0 || skills.length > 0 || education.length > 0;

  if (!hasData) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-gray-50 to-gray-100">
        <div className="text-2xl font-medium text-gray-700 flex items-center">
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 mr-2" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9.172 16.172a4 4 0 015.656 0M9 10h.01M15 10h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
          </svg>
          暂无数据
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 to-gray-100">
      {profile && <Hero profile={profile} />}
      {skills.length > 0 && <Skills skills={skills} />}
      {experiences.length > 0 && <ExperienceSection experiences={experiences} />}
      {projects.length > 0 && <Projects projects={projects} />}
      {education.length > 0 && <EducationSection education={education} />}
      <Footer />
    </div>
  );
}
